import React, {useEffect} from "react";
import FeedBack from "./FeedBack";
import {connect} from "react-redux";
import {getFeedBackThunk} from "../../Redux/Reduser";

export const FeedBackContainer=({getFeedBackThunk,feedback})=>{
    useEffect(()=>{
        getFeedBackThunk();
    },[getFeedBackThunk])
    return <FeedBack feedback={feedback}/>
}

const mapStateToProps=(state)=>{
    return{
        feedback:state.Reduser.feedback
    }
}

export default connect(mapStateToProps,{getFeedBackThunk})(FeedBackContainer)
